original_question:
Dwanaście kwadratów o wymiarach 1 na 1 tworzy prostokąt, jak pokazano. Jaka jest całkowita powierzchnia zacieniowanego obszaru? [asy]
size(4cm);defaultpen(linewidth(0.75));

// Wypełnione części
fill((0, 4)--(0, 0)--(2, 0)--cycle, gray(0.75));
fill((0, 4)--(3, 4)--(3, 0)--cycle, gray(0.75));

// siatka
int j;
for (j = 0; j < 4; ++j) {draw((j, 0)--(j, 4));}
for (j = 0; j < 5; ++j) {draw((0, j)--(3, j));}

// przekątne
draw((0, 4)--(3, 0)); draw((0, 4)--(2, 0));
[/asy]

